import { useEffect, useState } from "react";
import { retrieveAFlightById, retrieveAllFlights } from "../api/CallingApi";

function FlightList() {
    const [flights, setFlights] = useState([]);
    const [message, setMessage] = useState(null);
    const [searchId, setSearchId] = useState("");
    const [loading, setLoading] = useState(false);

    // Load all flights on initial render
    useEffect(() => {
        flightList();
    }, []);

    function flightList() {
        setLoading(true);
        retrieveAllFlights()
            .then((response) => {
                setFlights(response.data || []);
                setMessage(null);
            })
            .catch(error => {
                console.error(error);
                setMessage("Failed to load flights");
                setFlights([]);
            })
            .finally(() => setLoading(false));
    }

    // Search by ID function
    function searchById() {
        if (!searchId.trim()) {
            setMessage("Please enter a flight ID");
            return;
        }

        setLoading(true);
        retrieveAFlightById(searchId)
            .then((response) => {
                if (response.data) {
                    setFlights([response.data]); // Wrap in array for consistent mapping
                    setMessage(null);
                } else {
                    setFlights([]);
                    setMessage("No flight found with that ID");
                }
            })
            .catch(error => {
                console.error(error);
                setMessage("Error searching for flight");
                setFlights([]);
            })
            .finally(() => setLoading(false));
    }

    function handleSearchChange(event) {
        setSearchId(event.target.value);
    }

    function handleKeyPress(event) {
        if (event.key === 'Enter') {
            searchById();
        }
    }

    return (
        <div className="container">
            <h1>Flights List</h1>
            {message && <div className="alert alert-warning">{message}</div>}
            {loading && <div className="alert alert-info">Loading...</div>}

            <div className="mb-3">
                <div className="input-group">
                    <input 
                        type="search" 
                        placeholder="Search flight by ID" 
                        value={searchId}
                        onChange={handleSearchChange}
                        onKeyPress={handleKeyPress}
                        className="form-control"
                    />
                    <button 
                        onClick={searchById} 
                        className="btn btn-primary"
                        disabled={loading}
                    >
                        Search
                    </button>
                    <button 
                        onClick={flightList} 
                        className="btn btn-secondary"
                        disabled={loading}
                    >
                        Show All
                    </button>
                </div>
            </div>

            <table className='table table-striped'>
                <thead className="thead-dark">
                    <tr>
                        <th>ID</th>
                        <th>Departure From</th>
                        <th>Arrival To</th>
                        <th>Departure</th>
                        <th>Return Date</th>
                        <th>Seats Available</th>
                    </tr>
                </thead>
                <tbody>
                    {flights.length > 0 ? (
                        flights.map(flight => (
                            <tr key={flight.id}>
                                <td>{flight.id}</td>
                                <td>{flight.departureFrom || "-"}</td>
                                <td>{flight.arrivalTo || "-"}</td>
                                <td>{flight.departure || "-"}</td>
                                <td>{flight.returnDate || "-"}</td>
                                <td>{flight.seatsAvailable || "0"}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="6" className="text-center">
                                {!loading && "No flights found"}
                            </td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
}

export default FlightList;
